class Solution {
	public int lengthOfLongestSubstring(String s) {
		char[] chars = s.toCharArray();
		int n = chars.length;
		if (n == 0) {
			return 0;
		}
		
		int start = 0;
		int m = 1;
		
		while (start < n-m && m < n) {
			if (contains(chars, start, start+m, n)) {
				start ++;
			} else {
				m ++;
			}
		}
		return m;
	}
	
	public boolean contains(char[] chars, int start, int end, int len) {
		if (end >= len) {
			return false;
		}
		char next = chars[end];
		for (int i = start; i < end; i++) {
			//下一个被包含在子串m中
			if (chars[i] == next) {
				return true;
			}
			
			//子串m包含重复元素
			for (int j = i+1; j < end; j++) {
				if (chars[i] == chars[j]) {
					return true;
				}
			}
		}
		return false;
	}
}

class Solution2 {
    public int lengthOfLongestSubstring(String s) {
    	char[] chars = s.toCharArray();
        int n = s.length();
        if (n == 0) {
        	return 0;
        }
        
        //假设长度为m的字串为最长字符串，总共有这么多个：sum(n-m+1), m in (n->1)
        for (int m = n; m > 0; m--) {
        	//比较所有长度为m的字串
        	for (int i = 0; i <= n - m; i++) {
            	//如果字串m没有重复元素，则m为最长字串
            	if (noRepeat(chars, i, i+m)) {
            		return m;
            	}
            }        	

        }
        return 1;
    }
    
    private boolean noRepeat(char[] sub, int start, int end) {
    	for (int i = start; i < end; i++) {
    		for (int j = i + 1; j < end; j++) {
    			if (sub[i] == sub[j]) {
    				return false;
    			}
    		}
    	}
    	return true;
    }
}